"""
Input : permissions needed

Output : a list of roles possibles
"""


def minimize_list_of_roles(roles_list):
    """
    if admin and something else is present in the list, we remove the admin one (ex: computeUser and computeAdmin
    are present, we remove computeAdmin
    """
    for role in roles_list:
        if 'admin' in role.lower():
            for role2 in roles_list:
                if role.lower().split('admin')[0] in role2:
                    roles_list.remove(role2)

    return roles_list

